import * as React from 'react';
import './Home.css'
import Card from '../components/Card/Card';

export interface IHomeProps {
}

export default class Home extends React.Component<IHomeProps> {
  public render() {
    return (
      <div className='body px-5'>
        <div className='status row'>
          <div className="card text-center col p-0">
            <div className="card-body d-flex align-items-start">
              <div className=''>
                <div className="statusNumber text-">4</div>
                <div className="statusDesc text-muted">Body</div>
              </div>

            </div>
            <div className="card-footer bg-primary text-white">
              Ver todos
            </div>
          </div>
          <div className='status-items col m-4 bg-dark'>
            Card
          </div>
          <div className='status-items col m-4 bg-primary'>
            Card
          </div>
          <div className='status-items col m-4  bg-dark'>
            Card
          </div>
        </div>
      </div>
    );
  }
}
